import React, { useState, useEffect } from 'react';
import { Link, useNavigate, useLocation, useParams } from 'react-router-dom';

function Update() {
    const navigate = useNavigate();
    const location = useLocation();
    const [client, setClient] = useState({});

    useEffect(() => {
        setClient(location.state);
    }, []);

    const url = useParams();
    const act = 'Update';

    const setInputs = (event) => {
        const temp = client;
        temp[event.target.id] = event.target.value;
        console.log(temp);
        setClient(temp);
    }

    const click = async () => {
        const data = await fetch(`http://localhost:3090/clients/${url.act}`, {
            method: 'POST',
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({ client: client })
        });
        navigate(-1);
    }

    return (
        <div className='container'>
            <h3 onClick={() => { navigate(-1); }}>X</h3>
            <div>
                <h1 className='form_title'>{act} Client</h1>
                <div className='form_input-group'>
                    <input type='text' className='form_input' id='firstName' onBlur={setInputs} placeholder={client.firstName} />
                </div>
                <div className='form_input-group'>
                    <input type='text' className='form_input' id='lastName' onBlur={setInputs} placeholder={client.lastName} />
                </div>
                <div className='form_input-group'>
                    <input type='text' className='form_input' id='clientId' onBlur={setInputs} placeholder={client.clientId} />
                </div>
                <div className='form_input-group'>
                    <span>Date Of Birth </span>
                    <input type='date' className='form_input' id='dateOfBirth' onBlur={setInputs} placeholder={client.dateOfBirth} />
                </div>
                <div className='form_input-group'>
                    <input type='text' className='form_input' id='telphone' onBlur={setInputs} placeholder={client.telphone} />
                </div>
                <div className='form_input-group'>
                    <input type='text' className='form_input' id='phone' onBlur={setInputs} placeholder={client.phone} />
                </div>
                <div className='form_input-group'>
                    <input type='text' className='form_input' id='vaccinsDate' onBlur={setInputs} placeholder={client.vaccinsDate} />
                </div>
                <div className='form_input-group'>
                    <input type='text' className='form_input' id='vaccineManufacturer' onBlur={setInputs} placeholder={client.vaccineManufacturer} />
                </div>
                <div className='form_input-group'>
                    <input type='text' className='form_input' id='positiveResult' onBlur={setInputs} placeholder={client.positiveResult} />
                </div>
                <div className='form_input-group'>
                    <input type='text' className='form_input' id='recoveryDate' onBlur={setInputs} placeholder={client.recoveryDate} />
                </div>

                <p>Vaccins Date: {client.vaccinsDate}</p>
            <p>Vaccins Producer: {client.vaccineManufacturer}</p>
            <p>Positive Result: {client.positiveResult}</p>
            <p>Recovery Date: {client.recoveryDate}</p>

                <button className='form_button' type='submit' onClick={click}>{act}</button>
            </div>
        </div>
    )
}


